actionConfiguration.body:
() => {
  let Cheat = 0;
  const CurrentTunePower = Select_Car_Detail.data[0].tunePower;
  const CurrentTuneHandling = Select_Car_Detail.data[0].tuneHandling;
  if (CurrentTunePower + CurrentTuneHandling === 34) {
    Cheat = 1;
  }
  if (Cheat === 0) {
    return storeValue("Fully", {
      "tunePower": "17",
      "tuneHandling": "17",
      "level": "8",
      "Number": "80",
      "Div": "4"
    }, false);
  } else {
    showAlert('检测到违规使用满改功能，已取消执行', 'error');
  }
}

